import React from "react";
import { GlobalContext } from "./GlobalContext";

const Produto = () => {
  const { dados } = React.useContext(dadosContext);

  if (dados.dados === null) return null;
  return (
    <div>
      <div>
        <h2>Produto</h2>
        <ul>
          <p>
            {dados.dados.map((produto) => {
              return <li key={produto.id}>{produto.nome}</li>;
            })}
          </p>
        </ul>
      </div>
    </div>
  );
};

export default Produto;
